import React from "react";

import { Container, Form, FormGroup, Label, Input, FormText } from "reactstrap";

const Login = () => {
  return (
    <Container>
      <Form>
        <FormGroup>
          <Label for="userName">UserName</Label>
          <Input
            type="text"
            name="username"
            id="userName"
            placeholder="username"
          ></Input>
        </FormGroup>
      </Form>
    </Container>
  );
};

export default Login;
